    <script>
    document.addEventListener("DOMContentLoaded", function() {
        window.MAP = map_416878fde175f0b2e6cf31ca6b068322;

        var STREETS = [];
        var STREET_NAMES = [];

        function dist(a,b) {
            var dx=a[0]-b[0];
            var dy=a[1]-b[1];
            return Math.sqrt(dx*dx + dy*dy);
        }

        function focusNearestStreet() {
            if(!navigator.geolocation) {
                alert("–ì–µ–æ–ª–æ–∫–∞—Ü–∏—è –Ω–µ –ø–æ–¥–¥–µ—Ä–∂–∏–≤–∞–µ—Ç—Å—è");
                return;
            }
            if(STREETS.length == 0) {
                alert("–ù–µ—Ç –¥–∞–Ω–Ω—ã—Ö –æ–± —É–ª–∏—Ü–∞—Ö");
                return;
            }

            navigator.geolocation.getCurrentPosition(function(pos){
                var user=[pos.coords.latitude, pos.coords.longitude];

                var bestIdx = 0;
                var bestD = dist(user, STREETS[0]);

                for(var i=1;i<STREETS.length;i++){
                    var d = dist(user, STREETS[i]);
                    if(d < bestD) {
                        bestD = d;
                        bestIdx = i;
                    }
                }

                var target = STREETS[bestIdx];

                // –ü–µ—Ä–µ–≤–æ–¥ —Ä–∞—Å—Å—Ç–æ—è–Ω–∏—è
                var dLatKm = (user[0] - target[0]) * 111.32;
                var dLonKm = (user[1] - target[1]) * (40075 * Math.cos(user[0]*Math.PI/180) / 360);
                var distKm = Math.sqrt(dLatKm*dLatKm + dLonKm*dLonKm);
                var meters = Math.round(distKm * 1000);
                var walkMin = Math.round((distKm / 5) * 60);

                // –ü–µ—Ä–µ–ª—ë—Ç
                MAP.flyTo(target, 16);

                // üî• –ì–ê–†–ê–ù–¢–ò–†–û–í–ê–ù–ù–û –ü–û–Ø–í–õ–Ø–ï–¢–°–Ø POPUP
                setTimeout(function() {
                    L.popup()
                     .setLatLng(target)
                     .setContent(
                        "<b>–ë–ª–∏–∂–∞–π—à–∞—è —É–ª–∏—Ü–∞:</b> " + STREET_NAMES[bestIdx] +
                        "<br><b>–†–∞—Å—Å—Ç–æ—è–Ω–∏–µ:</b> " + meters + " –º" +
                        "<br><b>–ü–µ—à–∫–æ–º:</b> ‚âà " + walkMin + " –º–∏–Ω"
                     )
                     .openOn(MAP);
                }, 300);
            },
            function(err) {
                alert("–û—à–∏–±–∫–∞ –≥–µ–æ–ø–æ–∑–∏—Ü–∏–∏: " + err.message);
            },
            {enableHighAccuracy:true});
        }

        var btn=document.createElement("button");
        btn.textContent="–ü–æ–∫–∞–∑–∞—Ç—å –±–ª–∏–∂–∞–π—à—É—é —É–ª–∏—Ü—É –∫–æ –º–Ω–µ";
        btn.style.position="absolute";
        btn.style.top="10px";
        btn.style.left="50%";
        btn.style.transform="translateX(-50%)";
        btn.style.padding="8px 12px";
        btn.style.background="white";
        btn.style.border="1px solid #888";
        btn.style.borderRadius="6px";
        btn.style.zIndex=99999;
        btn.onclick = focusNearestStreet;
        document.body.appendChild(btn);
    });
    </script>
